import './Landing.css';
import Slider from 'react-animated-slider';
import 'react-animated-slider/build/horizontal.css';
import {LANDING} from '../../const.js';


function Landing(){
  return (
    <div className="Landing">
      <div className='leftLanding'>
        <div className='infoBox'>Interesting intro and information about this service providing company</div>
        <div className='buttonBox'>
          <a id='login' className='button' href="" target="_blank">Login</a>
          <a id='signUp' className='button' href="" target="_blank">Get started</a>
        </div>
      </div>

      <div>


      <Slider
        className='slider'
        autoplay={3000}
        previousButton={null}
        nextButton={null}
      >
        {LANDING.map((item, index) => (
          <div
            key={index}
            style={{
              background: `url('${item.image}') no-repeat center center`,
              backgroundSize: `contain`,
            }}
          ></div>
        ))}
      </Slider>



        {/* <img className='rightLanding' src={item.src} alt='stoicThumbsUp' /> */}
      </div>
    </div>
  )
}

export default Landing;

